import React, { useState, useEffect } from "react";
import { usePlaidLink } from "react-plaid-link";
import axios from "axios";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography } from "@mui/material";

const PlaidIntegration = ({ setAccessToken }) => {
  const [linkToken, setLinkToken] = useState(null);
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch link token from backend
  useEffect(() => {
    const fetchLinkToken = async () => {
      try {
        const response = await axios.post("http://localhost:5000/api/create_link_token");
        setLinkToken(response.data.link_token);
      } catch (error) {
        console.error("Error creating link token:", error);
      }
    };
    fetchLinkToken();
  }, []);

  // Fetch bank data after authentication
  const fetchBankData = async () => {
    setLoading(true);
    try {
      const response = await axios.get("http://localhost:5000/api/accounts");
      
      console.log("ðŸš€ API Response:", response.data);
      
      if (!response.data || !Array.isArray(response.data.transactions)) {
        throw new Error("Invalid transactions data received");
      }
  
      setTransactions(response.data.transactions);
    } catch (error) {
      console.error("âŒ Error fetching financial data:", error);
      setTransactions([]); // Ensure it's an empty array if an error occurs
    }
    setLoading(false);
  };
  

  // Plaid Link setup
  const { open, ready } = usePlaidLink({
    token: linkToken,
    onSuccess: async (publicToken) => {
      try {
        const response = await axios.post("http://localhost:5000/api/exchange_public_token", { public_token: publicToken });
        setAccessToken(response.data.access_token);
        fetchBankData(); // Fetch bank data after linking
      } catch (error) {
        console.error("Error exchanging token:", error);
      }
    },
  });

  // Helper function to group transactions by month
  const groupTransactionsByMonth = () => {
    if (!Array.isArray(transactions)) {
      console.error("ðŸš¨ Transactions is not an array:", transactions);
      return {}; // Return an empty object to prevent errors
    }
  
    const grouped = {};
    transactions.forEach((transaction) => {
      const date = new Date(transaction.date);
      const monthYear = date.toLocaleString("default", { month: "long", year: "numeric" });
  
      if (!grouped[monthYear]) {
        grouped[monthYear] = [];
      }
      grouped[monthYear].push(transaction);
    });
  
    return grouped;
  };

  const groupedTransactions = groupTransactionsByMonth();
  console.log("Grouped Transactions:", groupedTransactions); // Debugging log

  return (
    <div style={{ padding: "20px", backgroundColor: "#1e1e1e", color: "white", minHeight: "100vh" }}>
      <Typography variant="h4" align="center" gutterBottom>
        Finance Advisor
      </Typography>
      <button onClick={open} disabled={!ready || !linkToken} style={{ marginBottom: "20px", padding: "10px 20px" }}>
        Connect Bank Account
      </button>

      {loading && <Typography variant="h6" align="center">Loading transactions...</Typography>}

      {!loading && transactions.length > 0 && (
        <div>
          {Object.entries(groupedTransactions).map(([month, transactions]) => (
            <div key={month} style={{ marginBottom: "30px" }}>
              <Typography variant="h6" style={{ fontWeight: "bold", marginBottom: "10px" }}>
                {month}
              </Typography>
              <TableContainer component={Paper} style={{ backgroundColor: "#2e2e2e", color: "white" }}>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell style={{ color: "white", fontWeight: "bold" }}>Bank</TableCell>
                      <TableCell style={{ color: "white", fontWeight: "bold" }}>Name</TableCell>
                      <TableCell style={{ color: "white", fontWeight: "bold" }}>Price</TableCell>
                      <TableCell style={{ color: "white", fontWeight: "bold" }}>Date</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {transactions.map((transaction) => (
                      <TableRow key={transaction.id}>
                        <TableCell style={{ color: "white" }}>{transaction.bank_name}</TableCell>
                        <TableCell style={{ color: "white" }}>{transaction.name}</TableCell>
                        <TableCell style={{ color: "white" }}>${transaction.amount.toFixed(2)}</TableCell>
                        <TableCell style={{ color: "white" }}>{new Date(transaction.date).getDate()}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default PlaidIntegration;
